4367	26	<p><b>ABOUT THE COLLECTION</b></p>\r\n<p>The UA Dissertations Collection provides open access to dissertations produced at the University of Arizona, including dissertations submitted online from 2005-present, and dissertations from 1924-2006 that were digitized from paper and microfilm holdings.</p>\r\n<p>We have digitized the entire backfile of master's theses and doctoral dissertations that have been submitted to the University of Arizona Libraries - since 1895! If you can't find the item you want in the repository and would like to check its digitization status, please contact us. </p>\r\n\r\n<p><br><br></p>\r\n<p><b>QUESTIONS?</b></p>\r\n<p>Please refer to the <a href="http://www.library.arizona.edu/help/tutorials/dissertations/index.html">Dissertations and Theses in the UA Libraries</a> guide for more details about UA Theses and Dissertations, and to find materials that are not available online. Email <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your questions about UA Theses and Dissertations.</p>	\N	0	\N	-1	0a829ed9-cb13-497c-9f6d-c4b59e5177b3
