4378	26	<p><b>ABOUT THE COLLECTION</b></p>\r\n\r\n<p>The UA Honors Theses Collection provides open access to Honors College theses produced at the University of Arizona, submitted electronically since 2008. Not all students opt to include their theses in the repository, so the collection is not comprehensive. </p>\r\n\r\n<p>Honors College theses from the late 1960s to 2005 are not online and are available only in Special Collections. These theses are not listed in the online catalog, but a separate card catalog for them is available in Special Collections. </p> \r\n\r\n<p>Individuals trying to obtain a record or copy of their own Honors College theses, such as electronic submissions since 2008 that are not included online, or paper Honors College submissions from 2006-2007, should contact the <a href="http://www.honors.arizona.edu/contact">Honors College.</a>.</p>\r\n\r\n<p>Important note for students submitting Honors Theses: your thesis needs to be submitted using the <a href="http://www.honors.arizona.edu/students/thesis-submission">Honors College Thesis Submission Form.</a> Please check with the <a href="http://www.honors.arizona.edu/contact">Honors College</a> for more information.</p>\r\n\r\n<p><br><br></p>\r\n<p><b>QUESTIONS?</b></p>\r\n\r\n<p>Please refer to the <a href="http://www.library.arizona.edu/help/tutorials/dissertations/index.html">Dissertations and Theses in the UA Libraries</a> guide for more details about UA Theses and Dissertations, and to find materials that are not available online. Email <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your questions about UA Theses and Dissertations.</p>	\N	0	\N	-1	119f4d4d-c977-4c81-87e1-d87a0924fa3e
