4388	26	<p><b>ABOUT THE COLLECTION</b></p>\r\n<p>The UA Master's Theses Collection provides open access to masters theses and reports produced at the University of Arizona, including theses submitted online from 2005-present and theses from 1895-2005 that were digitized from microfilm and print holdings, in addition to master's reports from the College of Architecture, Planning and Landscape Architecture from 1966 onwards. The collection includes hundreds of titles not available in ProQuest.</p>\r\n\r\n<p>We have digitized the entire backfile of master's theses and doctoral dissertations that have been submitted to the University of Arizona Libraries - since 1895! If you can't find the item you want in the repository and would like to check its digitization status, please contact us. </p>\r\n\r\n<p>The UA Master's Theses collection is not comprehensive; master's theses from 1993-2015 were only received and archived by the UA Library and ProQuest if the student chose to pay the optional archiving fee. The Library does not have copies of many master's theses submitted during this time period. Some academic departments may keep copies of theses submitted to their programs. Colleges and departments wishing to archive master's theses not available in the University Libraries are encouraged to contact us at <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a>. </p>\r\n\r\n<p><br><br></p>\r\n<p><b>QUESTIONS?</b></p>\r\n<p>Please refer to the <a href="http://www.library.arizona.edu/help/tutorials/dissertations/index.html">Dissertations and Theses in the UA Libraries</a> guide for more details about UA Theses and Dissertations, and to find materials that are not available online. Email <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your questions about UA Theses and Dissertations.</p>	\N	0	\N	-1	ce9843d4-6dac-4ddf-9d50-51ce2ffed527
