905	26	<p><b>ABOUT THE COLLECTION</b></p>\r\n<p><i>Desert Plants</i> is a unique botanical journal published by The University of Arizona for Boyce Thompson Southwestern Arboretum. This journal is devoted to encouraging the appreciation of indigenous and adapted arid land plants. <i>Desert Plants</i> publishes a variety of manuscripts intended for amateur and professional desert plant enthusiasts. A few of the diverse topics covered include desert horticulture, landscape architecture, desert ecology, and history. First published in 1979, <i>Desert Plants</i> is currently published biannually with issues in June and December.</p><p>Digital access to this material is made possible by the College of Agriculture and Life Sciences, Boyce Thompson Southwestern Arboretum, and the University Libraries at the University of Arizona.</p>\r\n\r\n<p><br></p>\r\n<p><b>QUESTIONS?</b></p>\r\n<p>Contact College of Agriculture and Life Sciences Publications at <a href="mailto:pubs@cals.arizona.edu">pubs@cals.arizona.edu</a>.</p>	\N	1	\N	-1	ba25d37c-8c4b-42c1-8a6c-0d6af565fb50
