4761	27	Some parasites have an ability to fabricate the behavior of their host and impel the host to guard parasites' offspring, which is popularly called as bodyguard manipulation. Psalis pennatula larva parasitized by a braconid parasitoid wasp Microplitis pennatula exhibits some behavioral changes including the guarding of the parasitoid pupa from its natural enemies. We hypothesized that these behavioral change exhibited by the parasitized host larva are induced by the parasitoid and can be considered as an example of bodyguard manipulation. Even though hyperparasitoids are the more specialized natural enemy of parasitoids than predators, very few studies tested the success of guarding parasitoid pupa against hyperparasitoids. This study analyzed the success of guarding behavior of the parasitized host against hyperparasitoids. The onsets of parasite-induced phenotypic alterations (PIPAs) in the parasitized host were inspected to analyze whether these behavioral changes in the host larva manifests gradually or abruptly. The study concludes that parasitized host larva defends the parasitoid pupa from hyperparasitoids and the PIPAs in the parasitized host develops abruptly only after the egression of parasitoid prepupa.	en_US	0	\N	-1	0c5e993f-59fa-4b59-9d00-1f502afa5442
