4815	27	The important concept of equilibrium has always been controversial in ecology, but a new, more general concept, an asymptotic environmentally determined trajectory (AEDT), overcomes many concerns with equilibrium by realistically incorporating long-term climate change while retaining much of the predictive power of a stable equilibrium. A population or ecological community is predicted to approach its AEDT, which is a function of time reflecting environmental history and biology. The AEDT invokes familiar questions and predictions but in a more realistic context in which consideration of past environments and a future changing profoundly due to human influence becomes possible. Strong applications are also predicted in population genetics, evolution, earth sciences, and economics.	en_US	0	\N	-1	22de1626-1478-49f2-aef1-1b787a91daac
