4927	27	Special relativity (SR) determines the properties of synchrotron radiation, but the corresponding mechanisms are frequently misunderstood. Time dilation is often invoked among the causes, whereas its role would violate the principles of SR. Here it is shown that the correct explanation of the synchrotron radiation properties is provided by a combination of the Doppler shift, not dependent on time dilation effects, contrary to a common belief, and of the Lorentz transformation into the particle reference frame of the electromagnetic field of the emission-inducing device, also with no contribution from time dilation. Concluding, the reader is reminded that much, if not all, of our argument has been available since the inception of SR, a research discipline of its own standing.	en_US	0	\N	-1	43612e93-661c-492e-8e28-e7738b08eeef
