4994	27	The maintenance of social/emotional information in working memory (SWM/EWM) has recently been the topic of multiple neuroimaging studies. However, some studies find that SWM/EWM involves a medial frontal-parietal network while others instead find lateral frontal-parietal activations similar to studies of verbal and visuospatial WM. In this study, we asked 26 healthy volunteers to complete an EWM task designed to examine whether different cognitive strategies- maintaining emotional images, words, or feelings- might account for these discrepant results. We also examined whether differences in EWM performance were related to general intelligence (IQ), emotional intelligence (EI), and emotional awareness (EA). We found that maintaining emotional feelings, even when accounting for neural activation attributable to maintaining emotional images/words, still activated a left lateral frontal-parietal network (including the anterior insula and posterior dorsomedial frontal cortex). We also found that individual differences in the ability to maintain feelings were positively associated with IQ and EA, but not with EI. These results suggest that maintaining the feelings of others (at least when perceived exteroceptively) involves similar frontal-parietal control networks to exteroceptive WM, and that it is similarly linked to IQ, but that it also may be an important component of EA.	en_US	0	\N	-1	fdfa2b57-7729-4805-82f6-dcaf9a61d8d5
