6321	27	We have identified a few thousand star clusters in the nearby, late-type\r\nspiral galaxy M101, including approximately 90 candidate ancient globular\r\nclusters (GCs), from multi-band Hubble Space Telescope (HST) images. We\r\nobtained follow-up low-resolution (R approximately 2000) optical spectroscopy\r\nfrom Gemini-GMOS for 43 total clusters, of which 18 are old GCs and 25 are\r\nyoung massive clusters (YMCs). We measure radial velocities for these clusters\r\nand find that, as expected, the YMCs rotate with the HI disk. The old GCs do\r\nnot show any obvious evidence for rotation and have a much higher velocity\r\ndispersion than the YMCs, suggesting that the GCs in M101 are likely part of a\r\nstellar halo or thick disk.	en_US	1	\N	-1	eedd9e7c-59c3-4add-b5ed-50776d01eb80
