539	26	<p><b>ABOUT THE COLLECTIONS</b></p>\r\n<p>The graduate and undergraduate research collections share, archive and preserve research from University of Arizona students. Collections include honors theses, master's theses, and dissertations, in addition to capstone and other specialized research and presentation topics.</p><br>\r\n<p><b>QUESTIONS?</b></p>\r\n<p>If you have questions about items in these collections, or are a faculty member who would like to provide students in your program an opportunity to showcase their research, please contact the Office of Digital Innovation & Stewardship at <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your request. We look forward to working with you.</p>	\N	1	\N	-1	6bdabe2f-e02e-4a84-98c3-2d14cf36ba26
