888	26	<p><b>ABOUT THE COLLECTION</b><p>\r\n<p>The <i>Arizona Historical Review</i> was published from 1928-1936, first by the Arizona State Historian, and then by The University of Arizona with the cooperation of Arizona Pioneers Historical Society.</p>\r\n\r\n<p>The volumes in this collection were digitized as part of efforts to represent Arizona history, under the "Preserving the History of Agriculture & Rural Life: State and Local Literature, Arizona, 1820-1845" grant from the National Endowment for the Humanities. The grant, administered by Cornell University, provided funding for land grant universities in the United States to digitize rare and fragile items from this time period. Scholars and librarians at the University of Arizona identified the materials to be included in the collection, and coordinated with libraries and other institutions to obtain materials for digitization.</p>\r\n<br>\r\n<p><b>QUESTIONS?</b> Contact us at <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your questions about items in this collection.</p>	\N	1	\N	-1	a636292d-e17a-44d9-99b7-32016e523f0e
