893	26	<p>ABOUT THE COLLECTION</p>\r\n<p><i>Arizona Land and People</i> is a publication of the College of Agriculture and Life Sciences at the University of Arizona. The periodical was first published in 1949 under the title <i>Progressive Agriculture in Arizona</i>. In 1982, the title changed to <i>Arizona Land and People</i>; the last issue was published in 2007. The publication is also available from 1999-2007 on the CALS website at <a href=" http://cals.arizona.edu/landandpeople/"> http://cals.arizona.edu/landandpeople/</a>.</p>\r\n\r\n<p>The <i>Arizona Land and People / Progressive Agriculture in Arizona</i> digital archive is a collaboration between the College of Agriculture and Life Sciences and the University Libraries at the University of Arizona.</p>\r\n\r\n<p><br></p>\r\n<p>QUESTIONS?</p>\r\n<p>Contact College of Agriculture and Life Sciences Publications at <a href="mailto:pubs@cals.arizona.edu">pubs@cals.arizona.edu</a>.</p>	\N	1	\N	-1	c8bd5892-18c3-4a49-9553-d49dab163638
