910	26	<p><b>ABOUT THE COLLECTION</b><p>\r\n<p><i>The Desert Magazine</i> was a periodical on life in the deserts and the Southwest, published from 1937-1951 by The Desert Press.</p>\r\n<p>The volumes in this collection were digitized as part of efforts to represent Arizona agricultural history and rural life from the period 1820-1945, under the "Preserving the History of Agriculture & Rural Life: State and Local Literature, Arizona, 1820-1845" grant from the National Endowment for the Humanities. The grant was administered by Cornell University; the grant provided funding for land grant universities in the United States to digitize rare and fragile items from this time period. Scholars and librarians at the University of Arizona identified the materials to be included in the collection, and coordinated with libraries and other institutions to obtain materials for digitization.</p>\r\n<br>\r\n<p><b>QUESTIONS?</b></p>\r\n<p>Please contact us at <a href="mailto:repository@u.library.arizona.edu">repository@u.library.arizona.edu</a> with your questions or comments about items in this collection.</p>	\N	1	\N	-1	f1ec81da-7fa9-4d43-be0b-33cdd65d4a16
