945	26	<p>ABOUT THE COLLECTION</p>\r\n<p>The <a href="https://www.aznvas.org">Arizona Nevada Academy of Science</a> (ANAS) is one of 47 regional scientific associations affiliated with the AAAS.  First established in 1956, as the Arizona Academy of Science, the Academy's purpose "is to stimulate scientific research and education; to disseminate scientific knowledge in the various fields of science; to promote fraternal relationships among those engaged in scientific work; to assist in developing and in making known the material and other resources of those two states; to encourage the publication of reports of scientific investigations; and to unify the scientific interests of the region."   Toward these ends ANAS publishes a refereed research journal <a href="https://aznvas.org/publications/"> (Journal of Arizona Nevada Academy of Science) </a> and hosts a regional scientific meeting each year. Proceedings from these Annual Meetings and complete papers from the hydrology sessions of the meetings (Hydrology and Water Resources in Arizona and the Southwest) are included in the repository collection.  The Academy is also affiliated with the <a href="https://www.soinc.org/ ">Science Olympiad</a> program and the <a href="https://azscitech.com">Arizona SciTech Festival</a>. All of ANAS' activities reflect the organization's commitment to the development of the next generation of scientists. </p>\r\n\r\n<p><br></p>\r\n<p>QUESTIONS?</p>\r\n<p>Visit <a href="https://www.aznvas.org">Arizona Nevada Academy of Science</a> (ANAS) for further information.</p>	\N	1	\N	-1	d4ed0b4a-34be-45eb-9f75-9f9683f26a31
