863	27	The city of Tucson is well known for its cycling culture and year-round moderate climate. It is a ‘Gold’ level cycling community according to the League of American Bicyclists. Less known about Tucson is that it can be a dangerous place to ride a bicycle. In an attempt to improve overall cyclist safety, the idea of implementing protected bike infrastructure is explored. With a focus on using protected bike lanes to create a low-stress network for bike movement, this project creates a rubric, and calibrates it against case-studies in New York City, Chicago, and Washington D.C., to analyze the potential streets in Tucson possess to host protected bike lanes.	en_US	1	\N	-1	67ade011-3c5c-44e2-ae9b-7011003df958
