1035	27	In our previous work S. Bubin et al., Chem. Phys. Lett. 647, 122 (2016), it was established that complex explicitly correlated one-center all-particle Gaussian functions (CECGs) provide effective basis functions for very accurate nonrelativistic molecular non-Born-Oppenheimer calculations. In this work, we advance the molecular CECGs approach further by deriving and implementing algorithms for calculating the leading relativistic corrections within this approach. The algorithms are tested in the calculations of the corrections for all 23 bound pure vibrational states of the HD+ ion.	en_US	1	\N	-1	49b191be-7c50-4afc-a38b-3c4465694e55
