1221	27	PURPOSE. Recessive mutations in CLN7/MFSD8 usually cause variant late-infantile onset neuronal ceroid lipofuscinosis (vLINCL), a poorly understood neurodegenerative condition, though mutations may also cause nonsyndromic maculopathy. A series of 12 patients with nonsyndromic retinopathy due to novel CLN7/MFSD8 mutation combinations were investigated in this study. METHODS. Affected patients and their family members were recruited in ophthalmic clinics at each center where they were examined by retinal imaging and detailed electrophysiology. Whole exome or genome next generation sequencing was performed on genomic DNA from at least one affected family member. Immunofluorescence confocal microscopy of murine retina cross-sections were used to localize the protein. RESULTS. Compound heterozygous alleles were identified in six cases, one of which was always p.Glu336Gln. Such combinations resulted in isolated macular disease. Six further cases were homozygous for the variant p.Met454Thr, identified as a founder mutation of South Asian origin. Those patients had widespread generalized retinal disease, characterized by electroretinography as a rod-cone dystrophy with severe macular involvement. In addition, the photopic single flash electroretinograms demonstrated a reduced b- to a-wave amplitude ratio, suggesting dysfunction occurring after phototransduction. Immunohistology identified MFSD8 in the outer plexiform layer of the retina, a site rich in photoreceptor synapses. CONCLUSIONS. This study highlights a hierarchy of MFSD8 variant severity, predicting three consequences of mutation: (1) nonsyndromic localized maculopathy, (2) nonsyndromic widespread retinopathy, or (3) syndromic neurological disease. The data also shed light on the underlying pathogenesis by implicating the photoreceptor synaptic terminals as the major site of retinal disease.	en_US	1	\N	-1	74a27bdf-9307-4776-a7a3-fc397ce00bfe
