1328	27	The successful analysis of LiDAR data for archaeological research requires an evaluation of effects of different vegetation types and the use of adequate visualization techniques for the identification of archaeological features. The Ceibal-Petexbatun Archaeological Project conducted a LiDAR survey of an area of 20 x 20 km around the Maya site of Ceibal, Guatemala, which comprises diverse vegetation classes, including rainforest, secondary vegetation, agricultural fields, and pastures. We developed a classification of vegetation through object-based image analysis (OBIA), primarily using LiDAR-derived datasets, and evaluated various visualization techniques of LiDAR data. We then compared probable archaeological features identified in the LiDAR data with the archaeological map produced by Harvard University in the 1960s and conducted ground-truthing in sample areas. This study demonstrates the effectiveness of the OBIA approach to vegetation classification in archaeological applications, and suggests that the Red Relief Image Map (RRIM) aids the efficient identification of subtle archaeological features. LiDAR functioned reasonably well for the thick rainforest in this high precipitation region, but the densest parts of foliage appear to create patches with no or few ground points, which make the identification of small structures problematic.	en_US	1	\N	-1	06620084-7173-4870-ac80-32366149214d
