1395	27	We demonstrate a simple protocol for repeatable and efficient contact poling of guest-host electro-optic (EO) polymer thin films over large areas on soda-lime glass substrates. The poled large-area (up to 13.5 cm(2)) thin films in this study exhibit very large second-order nonlinear susceptibilities (d(33) values of 330-520 pm/V) for second-harmonic generation (SHG) and associated large Pockels coefficients (r(33) values of 105-180 pm/V) at the wavelength of 1.3 mu m. The poling protocol also produced poled EO thin films with excellent optical homogeneity and large positive birefringence with small variation (similar to 10(-3)) of refractive indices over the poled large areas. The study suggests a viable and scalable path towards the realization of integrated photonics based on pre-poled thin films of high performance EO polymers. (C) 2017 Optical Society of America	en_US	1	\N	-1	9fca0e15-0c5c-406d-ac30-714ed36bc54f
