1461	27	Magneto-optical (MO) composites with excellent Faraday rotation (FR) response were fabricated using iron platinum (FePt) nanoparticles (NPs) and polystyrene-block-poly (2-vinyl pyridine) (PS-b-P2VP) block copolymers (BCPs). Gallic acid functionalized FePt NPs with average core diameters (dcore) of 1.9, 4.9, 5.7 and 9.3 nm have been selectively incorporated into a P2VP domain through hydrogen bonding interactions. The use of copolymer templates to selectively arrange the magnetic NPs guaranteed high MO performance with little trade-off in terms of scattering loss, providing a simple strategy to prepare functional materials for MO applications. As a result, Verdet constants of a 10 wt % loaded 4.9 nm FePt NP composite reached absolute magnitudes as high as similar to-6 x 104 degrees/T-m at 845 nm, as determined by FR measurements at room temperature. At the same time, the MO figure-of-merit was as large as -25 degrees/T in these composites, indicating both excellent MO performance and transparency. The dependence of the nanocomposite FR properties on particle diameter, loading (from 0.1 wt % to 10 wt %) and composite nanostructure were systematically investigated at four infrared wavelengths (845, 980, 1310 and 1550 nm). (C) 2017 Optical Society of America	en_US	1	\N	-1	038e2e64-1524-441d-955d-dfe1620f5188
