1665	27	This article reports a measurement of the proper motion of Leo II, a dwarf galaxy that is a likely satellite of the Milky Way, based on imaging with the Hubble Space Telescope and Wide Field Camera. 3. The measurement uses compact background galaxies as standards of rest in both channels of the camera for two distinct pointings of the telescope, as well as a QSO in one channel for each pointing, resulting in the weighted average of six measurements. The measured proper motion in the the equatorial coordinate system is (mu(alpha), mu(delta))= (-6.9 +/- 3.7, -8.7 +/- 3.9) mas century(-1) and in the Galactic coordinate system it is (mu(l), mu(b)) = (6.2 +/- 3.9, -9.2 +/- 3.7) mas. century(-1). The implied space velocity with respect to the Galactic center is (Pi, Theta, Z) =(-37 +/- 38, 117 +/- 43, 40 +/- 16) km s(-1) or, expressed in Galactocentric radial and tangential components, (V-r, V-tan) = (21.9 +/- 1.5, 127 +/- 42) km s(-1). The space velocity implies that the instantaneous orbital inclination is 68 degrees, with a 95% confidence interval of (66 degrees, 80 degrees). The measured motion supports the hypothesis that Leo. II, Leo. IV, Leo. V, Crater. 2, and the globular cluster Crater fell into the Milky Way as a group.	en_US	1	\N	-1	bb0c8fcf-ebc6-4b89-b345-bcd6a66b7edb
