1889	27	The North American Monsoon (NAM) provides critical water resources to the U.S. southwest and northwestern Mexico. Despite its importance to regional hydrology, the mechanisms that shape this monsoon are not fully understood. In this paper, we use model simulations of the Last Glacial Maximum (LGM, 21kaB.P.) to assess the sensitivity of the NAM to glacial boundary conditions and shed light on its fundamental dynamics. We find that atmospheric changes induced by ice sheet albedo reduce NAM intensity at the LGM. The high albedo of the Laurentide ice sheet cools the surface and drives anomalous northwesterly winds that reduce the monsoon circulation and import cold, dry air into the core NAM region. Our work emphasizes the role of ice sheet albedo rather than topography in driving the atmospheric changes that modulate the glacial NAM, and ties our understanding of the NAM to broader theories of monsoon systems.	en_US	1	\N	-1	22d8221e-68bd-4223-bdd8-278bcece0b11
