2014	27	We report results from a study of nitric oxide nightglow over the northern hemisphere of Mars during winter, the southern hemisphere during fall equinox, and equatorial latitudes during summer in the northern hemisphere based on observations of the and bands between 190 and 270nm by the Imaging UltraViolet Spectrograph (IUVS) on the Mars Atmosphere and Volatile EvolutioN mission (MAVEN) spacecraft. The emission reveals recombination of N and O atoms dissociated on the dayside of Mars and transported to the nightside. We characterize the brightness (from 0.2 to 30kR) and altitude (from 40 to 115km) of the NO nightglow layer, as well as its topside scale height (mean of 11km). We show the possible impact of atmospheric waves forcing longitudinal variability, associated with an increased brightness by a factor of 3 in the 140-200 degrees longitude region in the northern hemisphere winter and in the -102 degrees to -48 degrees longitude region at summer. Such impact to the NO nightglow at Mars was not seen before. Quantitative comparison with calculations of the LMD-MGCM (Laboratoire de Meteorologie Dynamique-Mars Global Climate Model) suggests that the model globally reproduces the trends of the NO nightglow emission and its seasonal variation and also indicates large discrepancies (up to a factor 50 fainter in the model) in northern winter at low to middle latitudes. This suggests that the predicted transport is too efficient toward the night winter pole in the thermosphere by approximate to 20 degrees latitude north.	en_US	1	\N	-1	2412f9a8-3de9-4e40-b677-f901cbd90488
