2145	27	Hybrid microstructured fibers, utilizing both air holes and high index cladding structures, provide important advantages over conventional fiber including robust fundamental mode operation with large core diameters (>30 mu m) and spectral filtering (i.e. amplified spontaneous emission and Raman suppression). This work investigates the capabilities of a hybrid fiber designed to suppress stimulated Brillouin scattering (SBS) and modal instability (MI) by characterizing these effects in a counter-pumped amplifier configuration as well as interrogating SBS using a pump-probe Brillouin gain spectrum (BGS) diagnostic suite. The fiber has a 35 mu m annularly gain tailored core, the center doped with Yb and the second annulus comprised of un-doped fused silica, designed to optimize gain in the fundamental mode while limiting gain to higher order modes. A narrow-linewidth seed was amplified to an MI-limited 820 W, with near-diffraction-limited beam quality, an effective linewidth similar to 1 GHz, and a pump conversion efficiency of 78%. Via a BGS pump-probe measurement system a high resolution spectra and corresponding gain coefficient were obtained. The primary gain peak, corresponding to the Yb doped region of the core, occurred at 15.9 GHz and had a gain coefficient of 1.92x10(-11) m/W. A much weaker BGS response, due to the pure silica annulus, occurred at 16.3 GHz. This result demonstrates the feasibility of power scaling hybrid microstructured fiber amplifiers	en_US	1	\N	-1	ba4fbe7a-6082-4407-92a0-42cc932117f9
