2171	27	Near-surface air temperature (SAT) over Greenland has important effects on mass balance of the ice sheet, but it is unclear which SAT datasets are reliable in the region. Here extensive in situ SAT measurements (similar to 1400 station-years) are used to assess monthly mean SAT from seven global reanalysis datasets, five gridded SAT analyses, one satellite retrieval and three dynamically downscaled reanalyses. Strengths and weaknesses of these products are identified, and their biases are found to vary by season and glaciological regime. MERRA2 reanalysis overall performs best with mean absolute error less than 2 degrees C in all months. Ice sheet-average annual mean SAT from different datasets are highly correlated in recent decades, but their 1901-2000 trends differ even in sign. Compared with the MERRA2 climatology combined with gridded SAT analysis anomalies, thirty-one earth system model historical runs from the CMIP5 archive reach similar to 5 degrees C for the 1901-2000 average bias and have opposite trends for a number of sub-periods.	en_US	1	\N	-1	d51d6541-6493-4488-9af4-581ef217cdfb
