2199	27	In 1964-68, the U.S. Congress enacted comprehensive legislation prohibiting discrimination in employment (1964 Civil Rights Act), voting (1965 Voting Rights Act), and housing (1968 Fair Housing Act). A half-century later, most scholars concur that voting rights was by far the most successful, fair housing was a general failure, and Title VII fell somewhere in between. Explanations of civil rights effectiveness in political sociology that emphasize state-internal resources and capacities, policy entrepreneurship, and/or the degree of white resentment cannot explain this specific outcome hierarchy. Pertinent to President Trump's policies, the authors propose an alternative hypothesis grounded in the sociology of law: the comparative effectiveness of civil rights policies is best explained by the extent to which each policy incorporated a group-centered effects (GCE) statutory and enforcement framework. Focusing on systemic group disadvantage rather than individual harm, discriminatory consequences rather than discriminatory intent, and substantive group results over individual justice, GCE offers an alternative theoretical framework for analyzing comparative civil rights outcomes.	en_US	1	\N	-1	5a4da525-cb59-4171-abb1-a92d228ce0cb
