2503	27	We measure the spectra of resonant Raman scattering and doping-induced absorption of pristine films of the pi-conjugated donor-acceptor (D-A) copolymer, namely, thieno[3,4 b] thiophene-alt-benzodithiophene (PTB7), as well as photoinduced absorption spectrum in a blend of PTB7 with fullerene phenyl-C61-butyric acid methyl ester molecules used for organic photovoltaic (OPV) applications. We find that the D-A copolymer contains six strongly coupled vibrational modes having relatively strong Raman-scattering intensity, which are renormalized upon adding charge polarons onto the copolymer chains either by doping or photogeneration. Since the lower-energy charge-polaron absorption band overlaps with the renormalized vibrational modes, they appear as antiresonance lines superposed onto the induced polaron absorption band in the photoinduced absorption spectrum but less so in the doping-induced absorption spectrum. We show that the Raman-scattering, doping-, and photoinduced absorption spectra of PTB7 are well explained by the amplitude mode model, where a single vibrational propagator describes the renormalized modes and their related intensities in detail. From the relative strengths of the induced infrared activity of the polaron-related vibrations and electronic transitions, we obtain the polaron effective kinetic mass in PTB7 using the amplitude mode model to be approximately 3.8m*, where m* is the electron effective mass. The enhanced polaronic mass in PTB7 may limit the charge mobility, which, in turn, reduces the OPV solar-cell efficiency based on the PTB7-fullerene blend.	en_US	1	\N	-1	9efe3b15-53da-4d88-b954-d3ca11cdac9d
