2602	27	Previous studies have shown that extracellular signal-regulated kinase 1/2 (ERK1/2) directly inhibits mitochondrial function during cellular injury. We evaluated the role of ERK1/2 on the expression of peroxisome proliferator-activated receptor gamma coactivator-1 alpha (PGC-1 alpha) gene, a master regulator of mitochondrial function. The potent and specific MEK1/2 inhibitor trametinib rapidly blocked ERK1/2 phosphorylation, decreased cytosolic and nuclear FOXO3a/1 phosphorylation, and increased PGC-1 alpha gene expression and its downstream mitochondrial biogenesis (MB) targets under physiological conditions in the kidney cortex and in primary renal cell cultures. The epidermal growth factor receptor (EGFR) inhibitor erlotinib blocked ERK1/2 phosphorylation and increased PGC-1 alpha gene expression similar to treatment with trametinib, linking EGFR activation and FOXO3a/1 inactivation to the down-regulation of PGC-1 alpha and MB through ERK1/2. Pretreatment with trametinib blocked early ERK1/2 phosphorylation following ischemia/reperfusion kidney injury and attenuated the downregulation of PGC-1 alpha and downstream target genes. These results demonstrate that ERK1/2 rapidly regulates mitochondrial function through a novel pathway, EGFR/ERK1/2/FOXO3a/1/PGC-1 alpha, under physiological and pathological conditions. As such, ERK1/2 down-regulates mitochondrial function directly by phosphorylation of upstream regulators of PGC-1 alpha and subsequently decreasing MB.	en_US	1	\N	-1	27b59b45-9ba0-4ea1-9348-cf944b2fe2e1
