2668	27	Background: Large-scale expansion of myogenic progenitors is necessary to support the development of high-throughput cellular assays in vitro and to advance genetic engineering approaches necessary to develop cellular therapies for rare muscle diseases. However, optimization has not been performed in order to maintain the differentiation capacity of myogenic cells undergoing long-term cell culture. Multiple extracellular matrices have been utilized for myogenic cell studies, but it remains unclear how different matrices influence long-term myogenic activity in culture. To address this challenge, we have evaluated multiple extracellular matrices in myogenic studies over long-term expansion. Methods: We evaluated the consequence of propagating mouse and human myogenic stem cell progenitors on various extracellular matrices to determine if they could enhance long-term myogenic potential. For the first time reported, we comprehensively examine the effect of physiologically relevant laminins, laminin 211 and laminin 521, compared to traditionally utilized ECMs (e.g., laminin 111, gelatin, and Matrigel) to assess their capacity to preserve myogenic differentiation potential. Results: Laminin 521 supported increased proliferation in early phases of expansion and was the only substrate facilitating high-level fusion following eight passages in mouse myoblast cell cultures. In human myoblast cell cultures, laminin 521 supported increased proliferation during expansion and superior differentiation with myotube hypertrophy. Counterintuitively however, laminin 211, the native laminin isoform in resting skeletal muscle, resulted in low proliferation and poor differentiation in mouse and human cultures. Matrigel performed excellent in short-term mouse studies but showed high amounts of variability following long-term expansion. Conclusions: These results demonstrate laminin 521 is a superior substrate for both short-term and long-term myogenic cell culture applications compared to other commonly utilized substrates. Since Matrigel cannot be used for clinical applications, we propose that laminin 521 could possibly be employed in the future to provide myoblasts for cellular therapy directed clinical studies.	en_US	1	\N	-1	3277e87c-e1ed-4f3f-840c-0fec3b5484cb
