2753	27	Sprawling development continues to be the common method of creating a built environment that facilitates the growing proportion of people living in urban settings. Inadvertently, this brings forth many social, economic, and environmental adversities that cause for a redirection of development. Adaptive use is an architectural conservation strategy takes an existing building and rehabilitates it so that it can serve a new use. The rehabilitation process improves the performance of an existing building while suppressing many of the negative effects associated with the sprawling development and new construction. The purpose of this report is to draw upon successful adaptive use practices to create an outline of methods can be applied to future projects of a similar nature.	en_US	1	\N	-1	4afe4a27-6674-4965-a649-738cfa96f526
