2802	27	A large portion of current architectural design practices utilize insulative materials that are outdated, unsustainable, and harmful to the environment. There is little consideration placed in the lifespan of the insulative materials and often lead towards negative ramifications the environment must face. Continuing in the track of sustainable development, an emerging material known as cellulose aerogel builds off precedent aerogel with a green twist. The issue with implementing a new material, especially one that lacks the research and development of presently used materials, is gathering enough interest to build research funding. Developing a new material that has the potential to mitigate the massive energy consumption could aid architects and designers in designing more sustainable buildings. A cellulose based aerogel system is fabricated with cellulose, a biomass found in nearly all living organisms, is the answer we may need to make sustainable building practices a reality. To determine the validity of a cellulose aerogel system, a rigorous material study and precedence scientific studies will be analyzed to understand the intrinsic properties. The culmination of this information is imperative to drive continued development and implementation under the optimal conditions. Cellulose aerogel will face a multitude of comparisons with each major used insulative materials such as concrete, wood, and fiberglass. Successfully completing these studies will help material researchers and designers to prepare for a greater sustainable future.	en_US	1	\N	-1	69d019c5-4073-4de5-9f8e-4705883636cc
