3162	27	Captivated by the sustainable design principles and concepts, this study explores the definition of what is net zero and how has this concept become the new standard in today’s society. By analyzing several case studies, the qualitative and quantitative data will give insight into developing the ideal performance of green and sustainable buildings in relation to a net zero energy focus. The idea of sustainable design began as an economic tool to reduce high energy consumption in order to minimize cost in building construction. Nonetheless, this practice has evolved further into elevating the social and environmental, as well as economic standards of building design in the twenty-first century.	en_US	1	\N	-1	6ae2f3d5-b8ac-450f-ae81-9ee80d47023d
