3215	27	There has been a nationwide movement which has promoted urban agriculture. The locale, seasonality, and methods of cultivation, have all entered the spotlight of public consciousness. While farmer’s markets, and co-ops may sometimes have limited accessibility with respect to cost another community gardens are branch of the urban agriculture movement which are highly accessible. The surge in popularity of community gardens came with the 2008 market crash, which created many foreclosures, and accordingly vacant lots. Where vacant lots are reclaimed by citizens, they create a sense of ownership within a community, they become physical manifestations of neighborhood rally cries, elbows rub, and community connections are made. With a relatively small amount of initial input, and continued care, there are tangible outputs, and literal fruits of labor. The popularity of these gardens extends to schools, and a whole branch of pedagogy which emphasizes place based learning. The benefits to these schools is tremendous; students are offered the opportunity to be academically engaged in a space other than the traditional classroom. Community gardens show the potential to create value from little input. With the benefit of a structured design process, there is potential to make school gardens learning space, in addition to growing space. The intent of this study is to explore the value created for these spaces by a formalized design process.	en_US	1	\N	-1	2f38280d-65a5-4b85-955c-eafed6c4bb65
