3244	27	Housing is a basic necessity that should be available to everyone at every income level. The danger of becoming a cost burdened household (household spending 30% or more of the area median income on housing costs) is high for all income levels. However, extremely low income households are one of the demographics that are the most susceptible because they have limited affordable housing units available to them at their income level. Addressing this gap between income and affordability in housing is something that is particularly important to ensure that these extremely low income households have enough money for not only housing but other basic necessities such as food. Various incentives and programs are out there to try and provide these extremely low income households with the affordable housing they need however, it does not always happen in the areas that are the most in need. This study will examine the supply and demand of affordable housing for extremely low income households in Tucson, Arizona. The research identifies areas that have clusters of extremely low income households that are cost burdened as well as the affordable housing units available to them. Based on this information funding sources are discussed and recommendations regarding how to implement more affordable housing units in the areas of need are discussed.	en_US	1	\N	-1	1fb90f1d-02a9-4dc7-83c6-d7567640b665
