3297	27	The idea of using nature, as a design model in building construction is not a new one; this innovative technique is known as biomimicry in architecture. This study focuses on biomimicry and its application in three buildings; The University of Arizona’s new Environmental and Natural Resource Phase 2 (ENR2) building; Architect Mick Pearce’s Eastgate Centre in Harare Zimbabwe; and Council House 2 (CH2) in Melbourne Australia. The research in this paper is centered around the ENR2 building, it examines the extent to which biomimcry is applied in terms of aesthetics and performance, by comparing it to the Eastgate Centre and CH2 buildings.	en_US	1	\N	-1	6f888f5d-2aa8-4c3d-9292-2e80cbe0f575
