3327	27	The state of brownfield redevelopment in areas such as the Midwest and the southern states have been well documented and supported by political action. The City of Tucson has a different social, economic, and political makeup than others. Brownfield remediation, therefore takes on a different ideal approach. In order to achieve an understanding of brownfield remediation within this metro area, economic statistics from neighborhoods harboring brownfields as well as information concerning active and successful sites such as the Greenway Connection, the Tucson International Airport, and the Old Fort Lowell Adkins property were analyzed. Neighborhoods with brownfields have lower median incomes, property values, percentage of family households, and higher unemployment than the average Tucson case. Lower economic status among stakeholders in concert with communal and area factors, contribute to stagnation in the remediation of these sites.	en_US	1	\N	-1	88c08e60-c7ba-44e3-a98b-6722fd08093c
