3356	27	This study analyzes 15 years of wildlife tracking data across more than 40 transects in the Sky Islands surrounding landscape to investigate how human-wildlife encounters may respond to a decade of land development. The average detection of species per visit (ADPV), the quantification for human-wildlife encounters and indicator of species richness, was calculated for each transect across two sample periods 2001-2011 and 2011-2015. ArcMap was used to visualize the ADPV across sampling sites in the Sky Islands region. The p-value was then calculated to determine whether there was a significant difference between the ADPV of all species and of focal species before and after 2011. The results concluded there was no significant difference and the null hypothesis was accepted.	en_US	1	\N	-1	e679e607-5aa1-4317-9e06-def8587f31d1
