3389	27	Abstract\r\n Suburbs have long been a place near and dear to the hearts of many, they provide private property, large homes and a sense of security. They have traditionally been located far from city centers and also far from jobs. The following paper researchers whether or not suburban homes can be updated to compensate for the extra distance their inhabitants have to commute to work. The study looks at three case houses in the focus area of Continental Ranch, a Pulte suburb. The follow research was performed using a cost benefit analysis on three case homes and four case vehicles. The results were calculated using available data, estimates and website based calculators. The five upgrades calculated were CFL/LED light bulb replacement, water fixture upgrades, fridge replacement, rainwater harvesting and installation of solar panels. The case homes varied in size from 1,369 to 3,609 square feet and were built between 1989 and 2001. The homes have between two to five bedrooms and two to three bathrooms. The cars chosen as vehicle options for comparison were the Toyota Prius, the Honda Civic, the Honda Odyssey and the Chevrolet Tahoe, all 2016 models. The results found that all three homes could be upgraded to compensate for the annual cost of gas consumption of all four car options. It should be noted that these calculations did not take into account the cost of the upgrades, but rather the savings it would procure.	en_US	1	\N	-1	6ff1bb30-1033-473d-96ee-295a4ff23c4f
