3446	27	This paper will look at the current information concerning sustainable strategies. It will look at the ones that have been used in the past as well as the strategies that are currently being used. After studying the existing material on sustainable practices and strategies the next step will be looking at three primary sources and determining strategies that will be most useful. The first source that will be used is a professional working in the field. Secondly buildings that are located in a cold arid climate will be studied and finally a program called climate consultant. The recommendations from all three sources will be compiled in a list, organized by how many sources recommended each strategy. The strategies that have the most recommendations will be implemented into a residential single family building design for cold arid climates.	en_US	1	\N	-1	404d71d8-4a40-4841-99a7-9e3307975921
