3581	27	Marine Corps forward operating bases (FOBs) operate in austere conditions where the reliance on resupply from main bases is a necessity. A FOB in Afghanistan requires at least 300 gallons of diesel fuel a day, in which each gallon delivered requires 7 gallons of fuel to get it there by convoy. Extensive resupply convoys offer a tactical disadvantage, especially when there is one Marine casualty for every 50 convoys. \r\n Private sector innovations in energy efficiency can offer a solution to inefficient energy use and Marine casualties from IEDs – improvised explosive devices. Data analysis of private sector innovations in the fields of flexible solar, fuel cells, and atmospheric water generation, provide direction into the future of sustainable forward operating base design. Each of the proposed innovations outscore current systems by vast margins in a weighted energy efficiency scale and therefore have the potential to elevate the energy efficiency of forward operating bases. Energy efficiency, in the case of the Marine Corps, is a combat multiplier. If they are able to free themselves from the burden of their increased energy use, they gain the ability to operate more aggressively, push deeper, and fight as a lighter, more lethal force.	en_US	1	\N	-1	946c2561-71ed-4757-8aab-98db7626f87e
