3607	27	The study is on non-profit organizations use of data to analyze and plan projects. It looks at Geographical Information Systems as a tool that could benefit organizations in their data management, project creation, and community collaboration. Case study research was used to analyze three different tree maps created by non-profit organizations. The case studies looked specifically at the organizations’ use of GIS in the data management, project creation, and community collaboration aspects of the maps. By looking at these aspects, it was concluded that GIS is a beneficial tool for non-profit organizations, even on the most basic level. As the organizations become more financially able to afford better software, the GIS capabilities become more beneficial. Non-profits should try to incorporate GIS at any level into their organization.	en_US	1	\N	-1	0d81b538-b4fb-4758-8aef-5bf677fd3858
