3660	27	This paper examines Subsurface Drip Irrigation(SDI) as a solution to water conservation in landscape irrigation. This is a problem because of the drought that the southwestern United States is experiencing, and the amount of water that landscapes utilize and which is ultimately wasted due to inefficient practices. Subsurface drip irrigation represents a potential solution due to its high efficiency and water saving ability; however, there are some problems within it as a system. Utilizing a multiple case studies approach, this paper looked at three of the top irrigation companies, Rain Bird, Toro, and Netafim, and examined how they innovated to overcome the problems with SDI. Synthesizing the best and most effective practices from each company, a model for improving SDI was generated.	en_US	1	\N	-1	79bce07e-af54-4df5-87b6-12aeda3eadac
