3709	27	The goal of this research is to define self sufficiency for mountain communities, understand the resources that make up a mountain community, and describe how current and future mountain communities can take steps toward self sufficiency. What the report explores and finds is that most mountain communities have all the resources available to become autonomous, sustainable areas able to support human, wildlife, and environmental health. This conclusion came from an extensive literature review on the resources of mountain communities, followed by analysis of the resources held in the mountain community of Summerhaven, Arizona. A list of prescriptive steps based on Summerhaven’s current needs is discussed, giving the community a ranked order of how they can utilize their resources to full potential and become autonomous to any outside resources. While further research into other communities is needed to more effectively understand the different scope of resource issues mountain communities are facing, this report has a general view of what effects all mountain communities. No two mountain communities will be the same in their resource needs, but the analysis on Summerhaven can be repeated in all existing communities. Self sufficiency in mountain communities is entirely possible and should be explored in order to make the mountain a healthy, sustainable, and beautiful landscape to be enjoyed by people for the rest of the time that they will be occupying Earth.	en_US	1	\N	-1	d4f373c4-d062-41f6-81b8-54e6b7eb94b9
