3737	27	This paper provides a study on the configuration of Stirling engines and the effect using a solar dish as a heat source on efficiency. The Stirling engine was based on the MIT 2.670 design - a Gamma configuration, low temperature differential Stirling engine. Temperature and speed were measured for the base model Stirling engine to determine the initial efficiency. Modifications were planned to add a parabolic mirror as a solar dish and compare the efficiency to the initial design, however, the completed solar Stirling engine testing and data collection is to be performed in the following summer. The work performed by the engine was to be calculated using the Schmidt formula to then find the power output. Results from the completion of this study would indicate how the solar dish effects the power output of the Stirling engine.	en_US	1	\N	-1	638298fd-2c45-41e0-8544-cc4713f9753e
