3767	27	This capstone project compares traditional agricultural methods to those of aquaponics. Qualitative research is used to study the effectiveness of aquaponic systems and its ability to solve the financial and environmental impacts of current agricultural methods. This study looks at the environmental, financial, and health impacts of agriculture. Three case studies are used to compare an aquaponic system, aquaculture operation, and an organic farm.	en_US	1	\N	-1	e0aa30b2-ced0-4001-bafa-1a24ea08f1f2
