3795	27	School gardens are booming in Arizona as their opportunities for educational development continue to grow. One common problem, however, is that most schools with a school garden lack a proper managerial system that would help their garden be used to its full potential. The work compiled in this capstone project defines a managerial structure and provides a site-specific example of an intern manual that is intended to be used as in introductory guide with all the necessary resources to get an intern started.	en_US	1	\N	-1	bb760a21-920a-4a3a-9d3b-3031f10b27ca
