3824	27	Climate change and resource availability are arguably the two biggest challenges humanity faces going forward. An unprecedented body of scientific work has been compiled over the past thirty years that indicates humans have and continue to be the largest driver of these environmental concerns, and therefore must also be responsible for any solutions. Buildings and their construction account for nearly 40% of the total energy consumption and greenhouse gas emissions in the United States. Water consumption by both buildings and thermoelectric power generation is also an issue, especially in the Southwest and Western United States. Green building has been gaining steam in the U.S. for the past two decades, but the primary focus has been in the commercial and industrial sectors. The residential markets have not seen the efficiency gains, primarily due to the perception that the cost isn’t worth the benefit.\r\n This project examines the need, feasibility, and potential benefits of sustainably retrofitting existing homes as an alternative to new construction. It provides a broad definition of sustainability and then focuses into a more narrow description of its application within the built environment. Using precedents, 3D modeling, and energy simulation software it compares the energy and water savings of a retrofit versus a base case as well as the performance of the average Southern Arizona home. Finally, this capstone project provides a professional cost estimate for the implementation of the proposed changes and a side-by-side look at the available “green” housing market, the utility cost savings for the homeowner, and the environmental benefits of individual as well as large-scale adoption of sustainable retrofitting practices. 	en_US	1	\N	-1	3e71710a-19ef-44c5-a3c3-eaed8ccf476d
