3854	27	Sustainable certifications are expanding in popularity within the built environment as the construction industry is progressing towards sustainability, while benefits are becoming more valuable to the businesses that reside in sustainably certified spaces. These benefits, such as thermal comfort and natural daylighting, not only translate to enhancing employee’s health, but employers within sustainably certified buildings have found greater retention rates in employees, improved business recruitment, as well as higher productivity in employees. The range of this analysis is directed towards two businesses that reside in sustainably certified buildings, DPR Construction-Phoenix in Arizona and the Mosaic Centre for Conscious Community and Commerce in Edmonton, Canada. Both buildings will be assessed for the impact their sustainable space have on their business. The purpose of this study is to examine the impacts of holistic and specific components of sustainability certifications, exclusively LEED and Net Zero Energy, on businesses. The study was unique as it was conducted by interviewing an integral consultant/designer in the construction process that still currently works in the building. The interview revealed that DPR Construction found employees to be more comfortable in their workspace, thus suggesting that productivity would be improved however this cannot be measured. The Mosaic Centre found new business advantages such as utilizing the space for tours and community engagement opportunities that have given the businesses within the Mosaic Centre unique marketing opportunities to improve business. This analysis will help commercial building owners gain insight on the business impacts of implementing sustainable building components to achieve a LEED certification, Net-Zero Status or a Living Building Challenge certification.	en_US	1	\N	-1	3802e86b-9f22-413f-af70-d9a3270a56e1
