3880	27	The study investigates how local-level efforts at sustainability have been implemented in developing countries and Caribbean islands. In order to protect resources and longevity of these regions, communities often adopt sustainable development initiatives with assistance of external support. The goal of this study is to evaluate initiatives taken by similar communities and organizations that have met the needs of ecosystems through sustainable action plans. The combined information gathered in this study will aid St. Croix, USVI in evaluating current practices as well as planning for future actions.\r\n \r\n The purpose of this research is to develop a case study of local-level sustainable development initiatives for St. Croix, USVI in order to address the needs of community members and environment through evaluations and successful frameworks of similar island communities. Through information collected, an analysis that addresses issues related to improving community for healthier communities via an improved built environment design, will investigate possible forms and systems of successful urban populations. This thesis addresses some of the issues related to improving community design for better civic health outcomes via an improved design and framework policy for the built environment. In order to explore this, the thesis seeks sustainable potentials in urban inner cities and island communities to develop an action plan and design for St. Croix. USVI.	en_US	1	\N	-1	8f111ce4-995b-4d17-a7a2-86f1703aa5ca
