3961	27	This capstone aims to study what types of sustainable renovation improvements would work best on older commercial buildings in Tucson. The issue being, what different types of upgrades are compatible with the types of buildings and environment in the Tucson area? This was determined with researching and comparing the data from three older buildings, which have undergone renovations and also received LEED certification. The results were significant in that the buildings studied had many similar improvements such as, installing high efficiency HVAC, upgrading insulation, using natural lighting to reduce artificial along with the usage of LED and or CFL bulbs. Low flow water fixtures were also used in all buildings to reduce water usage. The differences were the building in Phoenix also installed solar panels, along with a solar chimney for cooling, as the other two did not due to their locations in Illinois and Michigan. When these renovations were analyzed, many could be utilized in the Tucson environment. However, depending on the type of structure being renovated, the installation of HVAC, and the need for insulation could vary, due to some older buildings being brick or adobe.	en_US	1	\N	-1	65aa44a0-17e9-42cf-82cc-da6668359987
