3987	27	In a society growing towards alternative modes of transportation, this study explores the phase 2 streetcar expansion for the Tucson area. Using case studies and research articles, a criteria of factors were created to best judge three predetermined expansion routes. A case study was then done on these routes to determine which route would be best for the area. In this study, the factors that were looked at and used to rank the three routes included; population density and average annual income of the surrounding area of the route (400 meter buffer), accessibility and connectivity, which includes; bus stops, bike lanes, walkability, traffic counts and possible park & ride development. The last factor used in the case study was proximity to destination, specifically how many ‘big destinations’ (destinations that experience high volumes of people) each route had. The proximity to destination factor also determined how good of a balance each route had with housing, work and amenities/leisure destinations.	en_US	1	\N	-1	0d0b6c8d-20d8-43cd-86f0-df0d4ab57904
