4074	27	This study is an analysis and definition of green building design and zero energy building. This distinguishes the different components that go into net zero building, and the feasibility of making it happen on current buildings, as well as ones in design. \r\n The study identifies a building currently in construction on the University of Arizona campus, and identifies its possibility of zero energy and how zero energy would affect the cost and performance of the building. Ultimately it is found that net zero is feasible for the Environmental Natural Resources Building 2 and the University of Arizona, and should be a component in the design and building process of future buildings on campus.	en_US	1	\N	-1	b9090569-329e-473f-b901-36af4bad3ef1
